import React from "react";

const Index = () => {
  return (
    <div style={{ display: "flex", width: "100%"}}>
      <div
        style={{
          display: "flex",
          width: "40%",
          height: "100%",
          backgroundColor: "red",
        }}
      ></div>
      <div
        style={{
          display: "flex",
          width: "60%",
          backgroundColor: "blue",
        }}
      ></div>
    </div>
  );
};

export default Index;
